export default (function(a,b,c,d,e){return {data:{TNdgNXMm2H:{data:{id:1156,attributes:{imdbId:"tt0054890",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjVkYzUzYjAtZmM4MS00OWYzLTgwY2YtZDg4ZDMyNTQ0MGEzXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"}],item_lang:{data:{id:1819,attributes:{title:b,plot:"In Argentina, family man Julio Madariaga (Lee J. Cobb) is the patriarch of his family and considers his farm paradise on Earth. One of his daughters, Dona Luisa Desnoyers (Harriet E. MacGibbon), has married French immigrant Marcelo Desnoyers (Charles Boyer) and they have one son, the playboy Julio (Glenn Ford), and one daughter, the gorgeous student of Sorbonne Chi Chi (Yvette Mimieux). His other daughter, Elena von Hartrott (Kathryn Givney), has married German Karl von Hartrott (Paul Lukas), and they have three sons: Heinrich (Karlheinz Böhm), Gustav (Brian Avery), and Franz (Richard Franchot). In 1938, Heinrich returns from Germany for a family reunion and when he tells that he has joined the S.S., the displeased Julio Madariaga has a heart attack and dies. When France is occupied by the Germans, the family reunites in Paris, and Franz is the Nazi administrator in France. The alienated Julio has a studio where he paints, and has a love affair with Marguerite Laurier (Ingrid Thulin), the wife of newspaper owner Etienne Laurier (Paul Henreid), who is fighting in Belgium. Meanwhile, Chi Chi joins the French resistance and is arrested. Julio uses the influence of his cousin Franz to release her. However, Chi Chi has an argument with Julio for his neutral position. When Chi Chi is tortured to death by the Gestapo, Julio joins the resistance, using his relationship with the Germans to get inside information.",slug:"the-four-horsemen-of-the-apocalypse"}}},books:{data:[{id:6503,attributes:{title:b,description:a,thumbnail:a,authors:[d],firstBook:true,published:"1919-01-01",publisher:a,subtitle:"From the Spanish of Vicente Blasco Ibanez"}},{id:6504,attributes:{title:b,description:a,thumbnail:a,authors:[e],firstBook:c,published:"1922-01-01",publisher:a,subtitle:"From the Spanish of Vicente Blasco Ibañez"}},{id:6505,attributes:{title:b,description:"Reproduction of the original: The Four Horsemen of the Apocalypse by Vicente Blasco Ibanez",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LkGyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:c,published:"2019-09-25",publisher:"BoD – Books on Demand",subtitle:a}},{id:6506,attributes:{title:"The Four Horsemen of the Apocalypse - Part Two",description:"SynopsisPublished in 1916, in full horror of the Great War, Vicente Blasco Ibáñez (1867-1928) represented with singular success in The Four Horsemen of the Apocalypse the different forces, interests and mentalities whose confrontation led to the first world conflagration. Structured around the story of two families -the Desnoyers and the Hartrott- that, although partially coming from a common trunk, each belong to one of the sides in conflict, the novel runs agilely through the Dantean scenarios of a broken Europe, on whose desolate battlefields the great vitalist who was Blasco finally makes the desire to live beat wild and invincible.In this edition the second of the 3 parts of this wonderful book of prophecies.Biography of Vicente Blasco IbáñezVicente Blasco Ibáñez (1867-1928) was a Spanish novelist, politician, and journalist who lived between the second half of the 19th century and the first decades of the 20th. The making of him literary took place between his native Valencia, Paris and Argentina, where he founded two colonies: Cervantes and Nueva Valencia. In his role as a journalist he wrote texts in both Spanish and Catalan. During his youth he founded the newspaper El Pueblo, in Valencia. He published more than 40 novels and short stories, and was mainly framed within the naturalistic current of French novelists of the late nineteenth century.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dS09zgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:c,published:"2021-02-20",publisher:a,subtitle:"An Exciting Book that Leads Us to Reflect on War and Our Way of Life"}},{id:6507,attributes:{title:b,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TRV9DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:c,published:"2018-12-02",publisher:"Litres",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940972333}}("","The Four Horsemen of the Apocalypse",null,"Vicente Blasco Ibáñez","Vicente Blasco Ibanez"))